Inspired by the Day 3 Prompt of Genuary 2022 "Space" 

///

When I was a kid, a family friend gifted me a collection of Quest science binders, each filled with a D.I.Y project. One of them was a planisphere, a circular mechanical device used to identify the visible stars in the sky at any time of the year. 

This token is inspired by antique celestial maps as well as the clean illustrations of today

/// Features

There are 10 color palettes, several border types and decorations. The set of constellations generated for each planisphere is unique.

// 

Double-click to save a 3840x3840 PNG snapshot. 

Warning: due to the way it is drawn, it may or may not render on mobile devices. 

Made by Sam Tsao (@sam___tsao) with P5.js
